window.bookSummaryJSON = "<p>Mine to protect. Mine to claim... She is <b>mine</b>.</p> <p><b>Dante</b></p> <p>I'm a trained assassin. Enlisted by the Fae Corps and instructed to kill, there is no place in my life for a fated mate. Then Gia crashes into my life. Flashing eyes, luscious lips that beg to be kissed. One whiff of her sugary scent and I know she is <b>mine</b>. But she's human, and no way can she withstand the barbaric mating practices of the Fae. I am too lethal. I should stay away. </p> <p>When she takes the hit meant for my target, I cannot let her die. So I do the only thing that will save her life...I form a soul-bond with the unconscious human. I want to make her bend to my will. I hadn't reckoned with craving her emotions, her feelings. Her love...</p> <p>When she breaks out of my lair, I will do anything to get her back. This time I will make her submit her all.... This time she cannot escape. Gia is <b>mine</b>.</p> <p>Note: <i>Stolen by the Fae</i> is a stand-alone paranormal romance novel,and the first in the emotional and exciting Fae's Claim Series. </p> <p><b>Features a snarly, possessive Fae male, intense love scenes, and a twist that will keep you gasping for more....</b></p>"; 
